import ReactDom from 'react-dom';



const curDate = new Date();
curDate = curDate.getHours();

const greetings = '';

if (curdate >= 1 && curDate <= 12) {
    greetings = 'Good Morning';

} else if (curDate >= 12 && curDate <= 19) {

    greetings = 'Good Afternoon';
} else {

    greetings = 'Good Night';
}


